lp them enjoy their time to the fullest, and to create “Fun For All Into The Future.” Allowing users to have confidence in BNEA’s privacy practices is essential to BNEA’s aspirations and success. For more information about BNEA&s;s privacy practices, please see our&l;/span&g; &l;a href=\&q;https://www.bandainamcoent.com/legal/privacy\&q; rel=\&q;noopener noreferrer\&q; target=\&q;_blank\&q;&g;Privacy Policy&l;/a&g;.&l;/p&g;&l;p class=\&q;ql-align-center\&q;&g;&l;br&g;&l;/p&g;&l;p class=\&q;ql-align-center\&q;&g;If you would like to exercise your data privacy rights for data controlled or stored by BNEA, please complete this form. BNEA will use the information provided to process your request and to maintain a record of your request.&l;/p&g;&l;p class=\&q;ql-align-center\&q;&g;&l;br&g;&l;/p&g;&l;p class=\&q;ql-align-center\&q;&g;After you submit this form, you will receive a response to the email address entered into the form below. Please verify your email address by following the instructions found in that email. Please note that BNEA will not process this request until you verify your email address.&l;/p&g;&l;p class=\&q;ql-align-center\&q;&g;&l;br&g;&l;/p&g;&l;p class=\&q;ql-align-center\&q;&g;If you do not receive an email, please check your junk or spam folders for the confirmation email. Once your email is verified, we will respond to you in accordance with applicable law. If you are located within the European Union, Switzerland, or the United Kingdom, we will endeavor to respond to your request as quickly as possible but no later than one calendar month from receipt of your request. For all other territories, we endeavor to respond to a verifiable consumer request within 45 days of receipt. If necessary, we will inform you if we require a 45 day extension to process your request or if we require additional information.&l;/p&g;&q;,&q;PreviousYear&q;:&q;Previous Year&q;,&q;potentialException&q;:&q;Potential Exception&q;,&q;uniqueIdDesc&q;:&q;&q;,&q;relationWit ation. &l;/span&g;&l;/li&g;&l;/ul&g;&l;p&g;&l;span style=\&q;color: rgb(67, 80, 90);\&q;&g;Sensitive personal information that Is \&q;publicly available\&q; is not be considered sensitive personal information or personal information.&l;/span&g;&l;/p&g;&q;,&q;formField83DisplayText&q;:&q;&l;p&g;This Privacy Webform cannot be used to exercise data privacy rights related to game or mobile application data (“Game Data”). To exercise your rights with respect to Game Data, please check the settings page or other similarly worded section of the applicable game or mobile application. To exercise your data privacy rights for Battle Train on Steam® and Nintendo Switch™, please send an email to privacy@bandainamcoent.com with the subject line \&q;Battle Train Privacy Request.\&q;&l;/p&g;&q;,&q;loyaltyIdDesc&q;:&q;Loyalty ID&q;,&q;authorizationHelpTextDisplayText&q;:&q;If you are an Authorized Agent, you must attach written authorization from the data subject indicating you have been authorized to submit their request.&q;,&q;OtpPassCodeSentTextWithTimeout&q;:&q;A one-time code has been sent to you via your phone number. Please input the code below to verify your identity within {{minutes}} minutes.&q;,&q;dateOfBirthDesc&q;:&q;&q;,&q;CPRATemplateDescriptionKey&q;:&q;&l;p class=\&q;ql-align-center\&q;&g;Use this template to create a web form with settings relevant to Data Subject Rights under the California Privacy Rights Act (CPRA).&l;/p&g;&q;,&q;applicableLawsDisplayText&q;:&q;&l;p&g;The following provinces have &l;a href=\&q;https://www.priv.gc.ca/en/privacy-topics/privacy-laws-in-canada/the-personal-information-protection-and-electronic-documents-act-pipeda/r_o_p/prov-pipeda/\&q; rel=\&q;noopener noreferrer\&q; target=\&q;_blank\&q; style=\&q;background-color: rgb(255, 255, 255);\&q;&g;private-sector privacy laws that may apply instead of&a;nbsp;PIPEDA&l;/a&g;. You should verify the law under which you are submitting your request.&l;/p&g;&l;p&g;&l;br&g;&l;/p&g;&l;ul&g;&l;li&g
